$(function() {

	//MODx pdoResources Ajax Filter
	//Filter Settings
	var fadeSpeed             = 200, // Fade Animation Speed
			ajaxCountSelector     = '.ajax-count', // CSS Selector of Items Counter
			ajaxContainerSelector = '.ajax-container', // CSS Selector of Ajax Container
			ajaxItemSelector      = '.ajax-item', // CSS Selector of Ajax Item
			ajaxFormSelector      = '.ajax-form', // CSS Selector of Ajax Filter Form
			ajaxFormButtonStart   = '.ajax-start', // CSS Selector of Button Start Filtering
			ajaxFormButtonReset   = '.ajax-reset', // CSS Selector of Button Reset Ajax Form
			sortDownText          = 'По убыванию',
			sortUpText            = 'По возрастанию';

	$('' + ajaxFormSelector + '').submit(function() {
		return false;
	});

	function ajaxCount() {
		if($('.ajax-filter-count').length) {
			var count = $('.ajax-filter-count').data('count');
			$(ajaxCountSelector).text(count);
		} else {
			$(ajaxCountSelector).text($(ajaxItemSelector).length);
		}
	}ajaxCount();

	function ajaxMainFunction() {
		$.ajax({
			data: $(ajaxFormSelector).serialize()
		}).done(function(response) {
			var $response = $(response);
			$(ajaxContainerSelector).fadeOut(fadeSpeed);
			setTimeout(function() {
				$(ajaxContainerSelector).html($response.find(ajaxContainerSelector).html()).fadeIn(fadeSpeed);
				ajaxCount();
			}, fadeSpeed);
		});
	}

	$(ajaxContainerSelector).on('click', '.ajax-more', function(e) {
	    $('.ajax-filter-count img').attr('src', 'images/icon/synchronization-animate.svg');
		e.preventDefault();
		var offset = $(ajaxItemSelector).length;
		$.ajax({
			data: $(ajaxFormSelector).serialize()+'&offset='+offset
		}).done(function(response) {
			$('.ajax-filter-count').remove();
			var $response = $(response);
			$response.find(ajaxItemSelector).hide();
			$(ajaxContainerSelector).append($response.find(ajaxContainerSelector).html());
			$(ajaxItemSelector).fadeIn();
			$('.ajax-filter-count img').attr('src', 'images/icon/synchronization.svg');
		});
	})

	$(ajaxFormButtonStart).click(function(e) {
		e.preventDefault();
		ajaxMainFunction();
	})
 
	$(ajaxFormButtonReset).click(function(e) {
		e.preventDefault();
		$(ajaxFormSelector).trigger('reset');
		$('input[name=sortby]').val('pagetitle');
		$('input[name=sortdir]').val('asc');
		ajaxMainFunction();
		ajaxCount();
	})

	$(''+ajaxFormSelector+' .filter').change(function() {
		ajaxMainFunction();
	})
	$(''+ajaxFormSelector+' .price-focus').change(function() {
		ajaxMainFunction();
	})
	$(''+ajaxFormSelector+' .tag-cloud').change(function() {
		ajaxMainFunction();
	})
	$(''+ajaxFormSelector+' .promotion-cloud').change(function() {
		ajaxMainFunction();
	})
	$('[data-sort-by]').click(function() {
		var ths = $(this);
		$('input[name=sortby]').val($(this).data('sort-by'));
		$('input[name=sortdir]').val($(this).data('sort-dir'));
		$('[data-sort-by]').removeClass('active');
		$(this).addClass('sortDownText').addClass('active');
	
		ajaxMainFunction();
	});

});

