$(document).ready(function(){
	$('.form').submit(function () {
		var $form = $(this);
		var $ButtonName = $form.find('button[type="submit"]').text();
		var order = $(this).find('input[name=order]').val();  
		var urlredirect =  $(this).find('input[name=urlredirect]').val();
		var fdata = $form.serialize();
		$.ajax({
			type: "POST",
			dataType: "json",
			url: "post.php",
			data: fdata, 
			beforeSend: function (data) {
				$form.find('button[type="submit"]').attr('disabled', 'disabled');
				$form.find('button[type="submit"]').text('Подождите...');
			}, 
			error: function (jqXHR, exception) {
				$form.find('button').prop('disabled', false);
				if (jqXHR.status === 0) { 
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Нет интернета, или другая ошибка. Лучше свяжитесь с нами по телефонам указаных в контактах'); 
					} else if (jqXHR.status == 404) { 
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Requested page not found (404)'); 
					} else if (jqXHR.status == 500) { 
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Internal Server Error (500). Лучше свяжитесь с нами по телефонам указаных в контактах'); 
					} else if (exception === 'parsererror') { 
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Requested JSON parse failed');
					} else if (exception === 'timeout') { 
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Time out error');
					} else if (exception === 'abort') { 
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Ajax request aborted');
					} else {
					$('.success').attr("src", 'images/warning.svg'); 
					$('.success-title').text('Ошибка'); 
					$('.success-description').text('Uncaught Error. ' + jqXHR.responseText); 
				}
			},
			success: function(data) {
				$form.find('button').prop('disabled', false); 
				if(data.result == 'false'){
				    $('.success').attr("src", data.img); 
				    $('.success-title').text(data.error); 
				    $('.success-description').text(data.text);  
				    $form.find('button[type="submit"]').text($ButtonName);
				    $form.find('button[type="submit"]').prop('disabled', false);
				    $form.find('input[name=phone]').val(''); 
				    $.arcticmodal('close'); 
				    alert(file);
				    $('#thanks-modal').arcticmodal();
				} else { 
				 
				    window.location.href = 'thanks';
				} 
			},
			complete: function (data) {  
				
			}
		});
		return false;
	});	
	})			
